  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Steward
  B. McKinney NWR outlines Refuge accomplishments during the 1993 calendar year. The
  report begins with a summary of the year's highlights and weather conditions. Land
  acquisition is covered. The report includes a planning section which discusses research
  and investigations. Refuge administration is outlined; information about personnel,
  manpower programs, volunteer programs, funding, safety, and technical assistance
  is given. Habitat management is also covered; subjects include wetlands and grasslands.
  The wildlife section of the report discusses wildlife diversity, endangered and
  threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
  game mammals, marine mammals, and marking and bird banding. The public uses of the
  Refuge described in this report include outdoor classrooms, interpretive programs,
  fishing, wildlife observation, outdoor recreation, and law enforcement. The equipment
  and facilities section of the report provides information about new construction,
  rehabilitation, major maintenance, equipment replacement, and communication systems.\",\n\t\"owner_org\":
